var userAuth = true;

export default class Home extends Component {
  state = {
  }

  render () {
    if (userAuth) {
        // LOGGED IN STUDENT LANDING
        return (
          <span>
            <LandingHero />
            <StudentLanding />
          </span>
        )
      } else {
      // GUEST LANDING
      return (
        <span>
          <LandingHero />
          <GuestLanding />
        </span>
      )
    }
   }
}
